const deleteRequest = (expression, result) => {
    fetch('/his', {
            method: 'DELETE',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({
                expression,
                result,
            }),
        }).then((res) => res.json())
        .then((res) => console.log(res))
}

export default deleteRequest
